import React from 'react';
import Navbar from '../../parcials/Navbar';
import {
    MDBCard,
    MDBCardBody,
    MDBContainer,
    MDBRow,
    MDBCol,
    MDBInput
} from 'mdbreact';

const styles = StyleSheet.create({
    container: {
      alignItems: 'center',
      backgroundColor: '#FF6666',
      flex: 1
    }
  });

const TransferSystemPage = () => {
    return (
        <Navbar>
            <br></br>
            <MDBContainer>
                <MDBCard>
                    <MDBCardBody>
                        <MDBRow style={styles.container}>
                            <MDBCol md='2'>
                                <MDBInput label='Upc' group type='text' validate />
                            </MDBCol>
                            <MDBCol md='2'>
                                <MDBInput label='Alu' group type='text' validate />
                            </MDBCol>
                            <MDBCol md='2'>
                                <MDBInput label='Talla' group type='text' validate />
                            </MDBCol>
                            <MDBCol md='2'>
                                <MDBInput label='Factura' group type='text' validate />
                            </MDBCol>
                            <MDBCol md='2'>
                                <MDBInput label='Tiendas' group type='text' validate />
                            </MDBCol>
                        </MDBRow>
                    </MDBCardBody>
                </MDBCard>
            </MDBContainer>
        </Navbar>
    )
}

export default TransferSystemPage;
